import React, { useContext } from "react";
import { GlobalContext } from "../services/AppContext";

const PersonalProfile = () => {
  const { data } = useContext(GlobalContext);
  return (
    data.user_settings.personal_details.text !== "" ? (
      <div className="flex-col">
        <h2>Personal Profile</h2>
        <div
          style={{ color: data.user_settings.personal_details.settings.textColor }}
          className={
            data.user_settings.personal_details.settings.fontSize +
            " flex " +
            data.user_settings.personal_details.settings.textPosition
          }
        >
          {data.user_settings.personal_details.text}
        </div>
      </div>
    ) : <></>
  );
};

export default PersonalProfile;
